import { Component } from '@angular/core';
import { UserService } from './components/login/user.service';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'vecoelo';
  constructor(private userService: UserService) {}

  get nomUtilisateurConnecte(): string | null {
    return this.userService.utilisateurConnecte?.pseudo || null;
  }
  deconnexion(): void {
    this.userService.deconnexion();
  }
}
<header>

    <nav>
      <!-- Partie 1: Navbar avec un bouton "Connexion" à droite -->
      <div class="navbar">
        <a href="" routerLink="/home"><img src="../assets/vecoelo-logo-blue.png" alt="">Veco-Elo</a>
        <div class="connexion">
          <button class="btn-forum" routerLink="/forum">Forum des problèmes</button>
          <ng-container *ngIf="nomUtilisateurConnecte; else connexionBtn">
            <h3>{{ nomUtilisateurConnecte }}</h3>
            <button class="btn-deconnexion" (click)="deconnexion()"><i class="material-icons">logout</i></button>
          </ng-container>
          <ng-template #connexionBtn>
            <button class="btn-connexion" routerLink="/connexion">Connexion</button>
          </ng-template>
        </div>
      </div>          
    </nav>
  </header>

<router-outlet></router-outlet>
